(()=>{
    const names = {
        ores: {
            37: "coal",
            38: "copper",
            39: "iron",
            40: "gold",
            41: "platinum",
            42: "diamond",
            43: "ruby",
            44: "sapphire",
            45: "emerald",
            46: "amethyst",
            47: "infernium",
            48: "realm_crystal",
        },
        53: "stone_c",
        54: "stone_c",
        55: "stone_c",
        56: "stone_c",
        57: "copper_c",
        58: "copper_c",
        59: "copper_c",
        60: "copper_c",
        61: "iron_c",
        62: "iron_c",
        63: "iron_c",
        64: "iron_c",
        65: "gold_c",
        66: "gold_c",
        67: "gold_c",
        68: "gold_c",
        69: "diamond_c",
        70: "diamond_c",
        71: "diamond_c",
        72: "diamond_c",
    };
    
    window.scan_ores = false;
    
    const looking_for = [[53, 72], [39, 48]];
    const yay_simon = {};
    const yay_use = {};
    window.yay_add = function(pos_x, pos_y, pos_z, type){
        type = Number(type);
        let good = (scan_ores ? names.ores[type] : 0) || names[type];
        /*
        for(let i = 0; i < looking_for.length; i++){
            const j = looking_for[i];
            if(typeof j == "object"){
                if(type >= j[0] && type <= j[1]){
                    good = true;
                    break;
                }
            }
            else if(type == j){
                good = true;
                break;
            }
        };
        */
        if(!good) return;
        
        // see if pos is logged; if not, then add it to yay_use
        const y = yay_simon[pos_y] || {};
        yay_simon[pos_y] = y;
        const z = y[pos_z] || {};
        y[pos_z] = z;
        if(z[pos_x]) return;
        z[pos_x] = true;
        const t = yay_use[type] || [];
        yay_use[type] = t;
        t.push([[pos_x, pos_y, pos_z], type]);
    };
    window.yay_rem = function(pos_x, pos_y, pos_z, type, use_i){
        const n_type = my_see(pos_x, pos_y, pos_z);
        let good = names.ores[n_type] || names[n_type];
        if(good) return;
        if(!yay_simon[pos_y]?.[pos_z]?.[pos_x]) return;
        yay_simon[pos_y][pos_z][pos_x] = false;
        yay_use[type].splice(use_i, 1);
    };
    let siy = 0;
    let siz = 0;
    let six = 0;
    window.s = function(x,y,z, w, size){
        if(!window.my_see) return;
        
        const ax = x-w;
        const bx = x+w;
        const ay = y-w;
        const by = y+w;
        const az = z-w;
        const bz = z+w;
        
        if(siy < ay) siy = ay;
        if(siz < az) siz = az;
        if(six < ax) six = ax;
        
        for(let i = 0; i < size; i++){
            if(six >= bx){
                six = ax;
                if(siz >= bz){
                    siz = az;
                    if(siy >= by){
                        siy = ay;
                    }
                    else{
                        siy++;
                    }
                }
                else{
                    siz++;
                }
            }
            else{
                six++;
            }
            
            
            const t = my_see(six, siy, siz);
            if(t == 1002) continue;
            yay_add(six, siy, siz, t);
        }
    };
    
    window.scan_size = 2000;
    window.scan_range = 80;
    const report_wl = 10;
    let report_i = 0;
    
    let ready = true;
    const p = function(){
        if(!ready) return;
        ready = false;
        
        try{
            if(!my_see || !my_guy) return;
            const pos = my_guy.eRA;
            const x = pos.eeE;
            const y = pos.eeI;
            const z = pos.eef;
            const rx = Math.round(x);
            const ry = Math.round(y);
            const rz = Math.round(z);
            
            // checks 64k blocks around the player
            // but only every once in a while
            s(rx,ry,rz, scan_range, scan_size);
            
            const d = function(ab){
                return ((ab[0][0] - x)**2 + (ab[0][1] - y)**2 + (ab[0][2] - z)**2);
            }
            
            // mess with block arrays to get flat array, first sorted by block type, then by closeness to player
            const t = [];
            for(let i in yay_use){
                t.push([i, yay_use[i]]);
            }
            t.sort((a,b) => b[0] - a[0]);
            
            for(let i = 0; i < t.length; i++){
                const u = t[i];
                u.sort((a,b) => d(a) - d(b));
            }
            const v = t.flat();
            
            const my_s = v.slice(0, 10);
            my_s.forEach(
                (ab, use_i) => yay_rem(
                    ab[0][0], ab[0][1], ab[0][2],
                    ab[1],
                    use_i
                )
            );
            
            if(report_i >= report_wl) report_i = 0;
            else{
                report_i++;
                console.log(
                    my_s.map(
                        ab => (
                            names[ab[1]] ||
                            names.ores[ab[1]]
                        ) +
                        " @ " +
                        ab[0].join(", ") +
                        " - " +
                        Math.sqrt(d(ab)).toFixed(0) +
                        "blocks away"
                    ).join("\n")
                );
            }
        }
        catch(e){
            console.log("frame err", e);
        }
        
        ready = true;
    };
    
    setInterval(p, 50);
})();


